// IIR Filter Coefficient computation function

typedef struct _EQCOEF_BLOCK
{
    eqCoef_t eqC[High_Bands][25];
    bassCoef_t BASS_eqC[Low_Bands][25];

} EQCOEF_BLOCK;

void ROCKEQ_Get_Coeff(short *pGain, long Fs, RKEffect *userEQ)
{

    uint32 r12 = 0;
    short Gain[31];

    //RKEffect   *pEffect = &pAudio->EffectCtl;
    // RKEffect  *pEffect = userEQ;
    EQCOEF_BLOCK *peqC;

    memcpy((char *)Gain, (char *)pGain, 2 * 31); //short 型
    //printf("31段EQ\n");
    peqC = rkos_memory_malloc(sizeof(EQCOEF_BLOCK));
    if (peqC == NULL)
    {
        printf("ERROR:31_peqC malloc fail\n\n");
        return;
    }
    memset(peqC, 0, sizeof(EQCOEF_BLOCK));

    switch (Fs)
    {
        int j;
    //------------0---------------
    case 0: //8khz
    case 1://11khz
    case 2://12khz
        r12 = 0;
        for (j = 24; j < 31; j++)
        {
            Gain[j] = 0x0c;
        }
        break;
    //------------1---------------
    case 3://16khz
    case 4://22khz
    case 5://24khz
        r12 = 1;
        for (j = 26; j < 31; j++)
        {
            Gain[j] = 0x0c;
        }
        break;
    //------------2---------------
    case 6://32khz
        r12 = 2;
        Gain[30] = 0x0c;
        break;
    //------------3---------------
    case 7://44khz
        r12 = 3;
        Gain[30] = Gain[30] & 0xff;
        break;
    //------------4---------------
    case 8://48khz
        r12 = 4;
        Gain[30] = Gain[30] & 0xff;
        break;
    //----------------------------
    default:
        r12 = 3;
        Gain[30] = Gain[30] & 0xff;
        break;

    }

    {

#if 1
        /*******11 ~ 31段系数 *********/
        //printf("r12 = %d  size=%d\n",r12,sizeof(peqC->eqC));
        ReadEqData((uint8 *)&peqC->eqC[0][0], (5 * 5 * 25 * Low_Bands * 4 + (r12 * sizeof(peqC->eqC))), sizeof(peqC->eqC)); //sizeof(peqC->eqC) = 2*21*5*25 sizeof(peqC->eqC)
        /*******1 ~ 10段系数 *********/
        //printf("peqC->BASS_eqC r12 = %d  size=%d\n",r12,sizeof(peqC->BASS_eqC));
        ReadEqData((uint8 *)&peqC->BASS_eqC[0], r12 * sizeof(peqC->BASS_eqC), sizeof(peqC->BASS_eqC));
        //printf("31_JTAG_DEBUG_eqC[0][0] = 0x%x\n",peqC->eqC[0][0]);
        //printf("31_JTAG_DEBUG_eqC[0][1] = 0x%x\n",peqC->eqC[0][1]);
        //printf("31_JTAG_DEBUG_eqC[0][2] = 0x%x\n",peqC->eqC[0][2]);
        //printf("31_JTAG_DEBUG_eqC[0][3] = 0x%x\n",peqC->eqC[0][3]);
        //printf("31_JTAG_DEBUG_eqC[0][4] = 0x%x\n",peqC->eqC[0][4]);

        //printf("31_JTAG_DEBUG_BASS_eqC[0][0] = 0x%x\n",peqC->BASS_eqC[0][0]);
        //printf("31_JTAG_DEBUG_BASS_eqC[0][1] = 0x%x\n",peqC->BASS_eqC[0][1]);
        //printf("31_JTAG_DEBUG_BASS_eqC[0][2] = 0x%x\n",peqC->BASS_eqC[0][2]);
        //printf("31_JTAG_DEBUG_BASS_eqC[0][3] = 0x%x\n",peqC->BASS_eqC[0][3]);
        //printf("31_JTAG_DEBUG_BASS_eqC[0][4] = 0x%x\n",peqC->BASS_eqC[0][4]);

#else
        {
            /*******11 ~ 31段系数 *********/
            char *p;
            p = (char *)&Eq_Table.eqArray[0];

            //printf("31Eq_Table[0] = 0x%x\n",Eq_Table.eqArray[0]);
            //printf("31Eq_Table[1] = 0x%x\n",Eq_Table.eqArray[1]);
            //printf("31Eq_Table[2] = 0x%x\n",Eq_Table.eqArray[2]);
            //printf("31Eq_Table[3] = 0x%x\n",Eq_Table.eqArray[3]);
            //printf("31Eq_Table[4] = 0x%x\n",Eq_Table.eqArray[4]);

            p = p + r12 * sizeof(peqC->eqC);
            memcpy(&peqC->eqC[0][0], p, sizeof(peqC->eqC));    //sizeof(peqC->eqC) = 2*5*5*25
            /*******1 ~ 10段系数 *********/
            p = (char *)&Eq_Table.bass_160hz[0];
            p = p + r12 * sizeof(peqC->BASS_eqC);
            memcpy(&peqC->BASS_eqC[0][0], p, sizeof(peqC->BASS_eqC));
            //printf("31peqC->BASS_eqC[0][0] = 0x%x\n",peqC->BASS_eqC[0][0]);
            //printf("31peqC->BASS_eqC[0][1] = 0x%x\n",peqC->BASS_eqC[0][1]);
            //printf("31peqC->BASS_eqC[0][2] = 0x%x\n",peqC->BASS_eqC[0][2]);
            //printf("31peqC->BASS_eqC[0][3] = 0x%x\n",peqC->BASS_eqC[0][3]);
            //printf("31peqC->BASS_eqC[0][4] = 0x%x\n",peqC->BASS_eqC[0][4]);

        }
#endif
    }

    if (g_FilterState.EQ_ps_factor != 0 || g_FilterState.EQ_ps_factor != 1 || g_FilterState.EQ_ps_factor != 2)
    {
        g_FilterState.EQ_ps_factor = 0;
    }

    /*******获取 11 ~ 31段系数 *********/
    {
        int  i, temp, seg = 0;
        temp = 8192; //ROCKB[r12][0][seg];  // 0x2156  8534
        for (i = 0; i < High_Bands; i++)
        {
            seg = Gain[i + Low_Bands]; //<<1;
            if (seg == 0x0c)
            {
                DB_0_flag[i + Low_Bands] = 1;
            }
            else
            {
                DB_0_flag[i + Low_Bands] = 0;
                temp = (((long)temp * peqC->eqC[i][seg].B) >> 13); //0x2156/*ROCKB[r12][i][seg]*/;

            }
            g_FilterState._a[i * 2] =  peqC->eqC[i][seg].a1; //0x3fc4;//ROCKa[r12][i][seg];
            g_FilterState._a[i * 2 + 1] = peqC->eqC[i][seg].a2; //0xe03b;//ROCKa[r12][i][seg+1];
            g_FilterState._b[i * 2] = peqC->eqC[i][seg].b1; //0xc03b;// ROCKb[r12][i][seg];
            g_FilterState._b[i * 2 + 1] = peqC->eqC[i][seg].b2; //0x1fc6; //ROCKb[r12][i][seg+1];
        }
        g_FilterState.factored_B = temp;
    }
    /*******获取 1 ~ 10段系数 *********/
    {
        //  if(pEffect->max_DbGain != 0)
        {
            int i;
            int seg;
            for (i = 0; i < Low_Bands; i++)
            {
                seg = Gain[i];
                DB_0_flag[i] = 0;
                if (seg == 0x0c)
                {
                    DB_0_flag[i] = 1;
                }

                g_bass_FilterState.coef[i * 5] =  peqC->BASS_eqC[i][seg].a1; //0x3fc4;//ROCKa[r12][i][seg];
                g_bass_FilterState.coef[i * 5 + 1] = peqC->BASS_eqC[i][seg].a2; //0xe03b;//ROCKa[r12][i][seg+1];
                g_bass_FilterState.coef[i * 5 + 2] = peqC->BASS_eqC[i][seg].b1; //0xc03b;// ROCKb[r12][i][seg];
                g_bass_FilterState.coef[i * 5 + 3] = peqC->BASS_eqC[i][seg].b2; //0x1fc6; //ROCKb[r12][i][seg+1];
                g_bass_FilterState.coef[i * 5 + 4] = peqC->BASS_eqC[i][seg].B;
                //printf("g_bass_FilterState.coef[%d*5]= %d\n",i,peqC->BASS_eqC[i][seg].a1);
                //printf("g_bass_FilterState.coef[%d*5+4]= %d\n",i,peqC->BASS_eqC[i][seg].B);
            }
        }

    }
    rkos_memory_free(peqC);
}


/*------------------------------------------------------------------------------
 Function:   EQ_ClearBuff
 Synopsis:
 Arguments:
 Returns:
------------------------------------------------------------------------------*/
void EQ_ClearBuff(void)
{
    int i;
    for (i = 0; i < 4 * High_Bands; i++)
    {
        g_FilterState.i_32buff[i] = 0;
    }
    for (i = 0; i < 4 * Low_Bands; i++)
    {
        g_bass_FilterState.i_32buff[i] = 0;
    }
    for (i = 0; i < 31; i++)
    {
        DB_0_flag[i] = 1;
    }
}

