void RockEQProcess(EQ_TYPE *pData, uint32 PcmLen, RKEffect *userEQ)
{
    RKEffect   *pEffect = userEQ;
    {
        //printf("pEffect->max_DbGain %d\n",pEffect->max_DbGain);
        if (pEffect->max_DbGain != 0)
        {
            // printf("RockEQReduce9dB\n");
            RockEQReduce9dB(pData, PcmLen * 2, 1, userEQ);
            // printf("@0000 pData[0]=0x%x point=%d\n",(*(pData+4)), (pData+4));
            /*160hz以上的高频处理*/
            RockEQFiltering(pData, PcmLen, 0, 2, userEQ); // left channel;
            //printf("@11111 pData[0]=0x%x point=%d\n",(*(pData+4)), (pData+4));
            RockEQFiltering(pData + 1, PcmLen, 1, 2, userEQ); // right channel
            RockEQFiltering_Gain(pData, PcmLen);
            // printf("@22222 pData[0]=0x%x point=%d \n",(*(pData+4)), (pData+4));

            /*160hz及以下的低频处理*/
            RockBassFiltering(pData, PcmLen, 0, 2); // left channel;
            // printf("@33333 pData[0]=0x%x point=%d\n",(*(pData+4)), (pData+4));
            RockBassFiltering(pData + 1, PcmLen, 1, 2); // right channel
            // printf("@44444 pData[0]=0x%x point=%d\n",(*(pData+4)), (pData+4));

        }
    }
}
